import React from "react";

const Layout = (props) => {
  return (
    <div>
      <nav>
        <ul>
          <li>Home</li>
          <li>Your List</li>
        </ul>
      </nav>
      <div className="container">{props.children}</div>
    </div>
  );
};

export default Layout;
